function addRemoveLinkToUsergroups() {
    $('.usergroups li:not(.addusergroups)').append(' ');
    $('<a />').attr('href', '#removetag').text('[Remove]').click(removeUserGroup).appendTo('.usergroups li:not(.addusergroups)');
}

function deleteUser(event) {
    event.preventDefault();
    if (confirm('Do you want to delete this user?')) {
        var item = $(this).parent().parent();
        var userid = ($(item).attr('id')).replace('user-', '');
        $.post(html_url + 'json/post/', {'deleteuser': userid}, function(data) {
            $(item).fadeOut(function() {
                $(this).remove();
            });
        }, 'json');
    }
}

function addGroups(event) {
    event.preventDefault();
    var addli = $(this).parent();
    var userid = ($(addli).parent().parent().attr('id')).replace('user-', '');
    $.getJSON(html_url + 'json/get/', {'data': 'admin', 'subdata': 'usergroups', 'userid': userid}, function(data) {
        if (data.state == 'success') {
            var groups = $('<select />').attr('name', 'appendgroups');
            if (data.groupsout[0]) {
                $.each(data.groupsout, function(i, group) {
                    $('<option />').val(group.id).text(group.name).appendTo(groups);
                });
                $('<form />').append(groups).dialog({
                    'title': 'Add group',
                    'width': 200,
                    'modal': true,
                    'buttons': {
                        'Add': function () {
                            var newgroup_id = $(this).children('select').children('option:selected').val();
                            var newgroup_name = $(this).children('select').children('option:selected').text();
                            $(this).dialog('close').dialog('destroy').remove();
                            $.post(html_url + 'json/post/', {'data': 'addusergroup', 'uid': userid, 'gid': newgroup_id}, function(data) {
                                $(addli).before(
                                    $('<li />').attr('id', 'user-' + userid + '-group-' +newgroup_id).append(
                                        $('<span />').text(newgroup_name)
                                    ).append(' ').append(
                                        $('<a />').attr('href', '#removetag').text('[Remove]').click(removeUserGroup)
                                    )
                                );
                            }, 'json');
                        }
                    }
                });
            } else
                alert('No new groups for user.');
        }
    });
}

function removeUserGroup(event) {
    event.preventDefault();
    if (confirm('Do you want to delete this group?')) {
        var element = $(this).parent();
        var userid = ($(element).parent().parent().attr('id')).replace('user-', '');
        var groupid = ($(element).attr('id')).replace('user-' + userid + '-group-', '');
        $.post(html_url + 'json/post/', {'data': 'delusergroup', 'uid': userid, 'gid': groupid}, function(data) {
            $(element).fadeOut(function() {
                $(this).remove();
            });
        }, 'json');
    }
}

function deleteGroup(event) {
    event.preventDefault();
    if (confirm('Do you want to delete this group?')) {
        var item = $(this).parent()
        var groupid = ($(item).attr('id')).replace('group-', '');
        $.post(html_url + 'json/post/', {'delgroup': groupid}, function(data) {
            $(item).fadeOut(function() {
                $(this).remove();
            });
        }, 'json');
    }
}

function toggleAdmin(event) {
    event.preventDefault();
    var link = $(this);
    var id = ($(link).parent().attr('id')).replace('group-', '');
    var admin = $(link).parent().hasClass('admin');
    var text = (admin) ? 'Do you want to remove admin status?' : 'Do you want to grant admin status?';
    if (confirm(text)) {
        if (admin) {
            $.post(html_url + 'json/post/', {'dropadmin': id}, function(data) {
                if (data.id == id) {
                    $(link).parent().toggleClass('admin');
                    $(link).text('(Non-admin)').click(toggleAdmin);
                }
            }, 'json');
        } else {
            $.post(html_url + 'json/post/', {'grantadmin': id}, function(data) {
                if (data.id == id) {
                    $(link).parent().toggleClass('admin');
                    $(link).text('(Admin)').click(toggleAdmin);
                }
            }, 'json');
        }
    } else
        return;
}

function activateUser(event) {
    event.preventDefault();
    var actlink = $(this);
    var userdiv = $(this).parent().parent();
    var userid = ($(userdiv).attr('id')).replace('user-', '');
    var activity = ($(userdiv).hasClass('active') && !$(userdiv).hasClass('inactive'));
    var text = (activity) ? 'Deactivate user?' : 'Activate user?';
    if (confirm(text)) {
        if (activity) {
            $.post(html_url + 'json/post/', {'deactivateuser': userid}, function(data) {
                if (data.id == userid) {
                    $(userdiv).removeClass('active').addClass('inactive');
                    $(actlink).text('Active').click('activateUser');
                }
            }, 'json');
        } else {
            $.post(html_url + 'json/post/', {'activateuser': userid}, function(data) {
                if (data.id == userid) {
                    $(userdiv).removeClass('inactive').addClass('active');
                    $(actlink).text('Deactive').click('activateUser');
                }
            }, 'json');
        }
    } else
        return;
}

//-- Categories (start) --//

function addNewCategory(event) {
    event.preventDefault();
    var form = $(this).serializeArray();
    if (form[0].name == 'catname') {
        addCat(form[0].value);
        $('#newcat #catname').val('');
    }
}

function addCat(name) {
    if (name) {
        $.post(html_url + 'json/post/', {'newcat': name}, function(data) {
            if (data == true) {
                destroyCategorylist();
                createCategorylist();
            }
        }, 'json');
    } else {
        alert('Please insert name.');
        return;
    }
}

function createCategorylist() {
    $('#categories').NestedSortableWidget({
        name: 'admin-cats',
        loadUrl: html_url + 'json/get/',
        loadUrlParams: {'data': 'admin', 'subdata': 'cats'},
        saveUrl: html_url + 'json/post/',
        handle: true,
        onLoad: addCatBtn
    });
}

function addCatBtn() {
    browseGroupBtn()
    catGroupBtn()
    catRemoveBtn();
}

function browseGroupBtn() {
    $('<a />').addClass('catbutton').attr('href', html_url + 'browse/categoriesedit/?browse').text('[Browse]').click(catBrowse).appendTo('.nsw-item-row > div');
}

function catBrowse(event) {
    event.preventDefault();
    var id = ($(this).parent().parent().parent().attr('id')).replace('nsw-item-', '');
    location.href = html_url + 'browse/?id=' + id;
}

function catGroupBtn() {
    $('<a />').addClass('catbutton').attr('href', html_url + 'admin/categoriesedit/?groups').text('[Groups]').click(catGroups).appendTo('.nsw-item-row > div');
}

function catGroups(event) {
    event.preventDefault();
    var id = ($(this).parent().parent().parent().attr('id')).replace('nsw-item-', '');
    $.getJSON(html_url + 'json/get/', {'data': 'admin', 'subdata': 'catgroups', 'catid': id}, function(data) {
        if (data.state == 'success') {
            var groups = data.groups;
            var allgroups = data.allgroups;
            catGroupDialog(id, groups, allgroups);
        }
    });
}

function catGroupDialog(catid, selected, allgroups) {
    var select = $('<select />').attr('name', 'groups').attr('multiple', 'multiple');
    $.each(allgroups, function(i, group) {
        var option = $('<option />').text(group.name).val(group.id);
        if (isGroupSelected(group, selected))
            $(option).attr('selected', 'selected');
        $(select).append(option);
    });
    var dialog = $('<form />').append(
        $('<p />').text('Select groups for this category.')
    ).append(select).dialog({
        title: 'Select groups',
        modal: true,
        closeOnEscape: false,
        resizable: false,
        draggable: false,
        buttons: {
            'Save': function() {
                var serialData = $(this).serialize();
                $.post(html_url + 'json/post/', {'data': 'catgroups', 'groups': serialData, 'catid': catid});
                $(this).dialog('close').dialog('destroy').remove();
            }
        }
    });
}

function isGroupSelected(cand, groups) {
    var bool = false;
    $.each(groups, function(i, valid) {
        if (cand.id == valid.gid)
            bool = true;
    });
    return bool;
}

function catRemoveBtn() {
    $('<a />').addClass('catbutton').attr('href', html_url + 'admin/categoriesedit/?delete').text('[Delete]').click(deleteCat).appendTo('.nsw-item-row > div');
}

function deleteCat(event) {
    event.preventDefault();
    var id = ($(this).parent().parent().parent().attr('id')).replace('nsw-item-', '');
    if (confirm('Do you really want to delete category ' + id)) {
        $.post(html_url + 'json/post/', {'deletecat': id}, function(data) {
            if (data == true) {
                    destroyCategorylist();
                    createCategorylist();
            }
        }, 'json');
    }
}

function destroyCategorylist() {
    $('#categories').NestedSortableWidgetDestroy();
}

//-- Categories (end) --//

//-- Pictures (start) --//

function changePg(event) {
    event.preventDefault();
    var oldlink = $(this);
    var pid = ($(this).attr('id')).replace('picpg-', '');
    var oldelem = $(this).prev()
    var oldtext = $(oldelem).text();
    var element = $(this).parent();
    $.getJSON(html_url + 'json/get/', {'data': 'photographers'}, function(pgs) {
        $(element).html('');
        $('<input />').attr('type', 'text').val(oldtext).autocomplete(pgs).appendTo(element).focus().blur(function() {
            var newtext = $(this).val();
            if (newtext) {
                $.post(html_url + 'json/post/', {'changepg': pid, 'text': newtext}, function(data) {
                    $(element).html(' ').prepend(
                        $(oldelem).text((data) ? newtext : oldtext)
                    ).append(
                        $(oldlink).click(changePg)
                    );
                }, 'json');
            } else {
                alert('Empty string, no changes.');
                $(element).html(' ').prepend(
                    $(oldelem).text(oldtext)
                ).append(
                    $(oldlink).click(changePg)
                );
            }
        });
    });
}

function changeYear(event) {
    event.preventDefault();
    var oldlink = $(this);
    var pid = ($(this).attr('id')).replace('picyear-', '');
    var oldelem = $(this).prev()
    var oldtext = $(oldelem).text();
    var element = $(this).parent();
    $(element).html('');
    $('<input />').attr('type', 'text').val(oldtext).appendTo(element).focus().blur(function() {
        var newtext = $(this).val();
        if (newtext) {
            $.post(html_url + 'json/post/', {'changeyear': pid, 'text': newtext}, function(data) {
                $(element).html(' ').prepend(
                    $(oldelem).text((data) ? newtext : oldtext)
                ).append(
                    $(oldlink).click(changeYear)
                );
            }, 'json');
        } else {
            alert('Empty string, no changes.');
            $(element).html(' ').prepend(
                $(oldelem).text(oldtext)
            ).append(
                $(oldlink).click(changePg)
            );
        }
    });
}

function changeDesc(event) {
    event.preventDefault();
    var oldlink = $(this);
    var pid = ($(this).attr('id')).replace('picdesc-', '');
    var oldelem = $(this).prev()
    var oldtext = $(oldelem).text();
    var element = $(this).parent();
    $(element).html('');
    $('<textarea />').attr('cols', '50').attr('rows', '5').val(oldtext).appendTo(element).focus().blur(function() {
        var newtext = $(this).val();
        if (newtext) {
            $.post(html_url + 'json/post/', {'changedesc': pid, 'text': newtext}, function(data) {
                $(element).html(' ').prepend(
                    $(oldelem).text((data) ? newtext : oldtext)
                ).append(
                    $(oldlink).click(changeDesc)
                );
            }, 'json');
        } else {
            alert('Empty string, no changes.');
            $(element).html(' ').prepend(
                $(oldelem).text(oldtext)
            ).append(
                $(oldlink).click(changePg)
            );
        }
    });
}

function addTag(event) {
    event.preventDefault();
    var addTagLink = $(this);
    var element = $(this).parent().parent();
    var pid = ($(element).attr('id')).replace('tags-', '');
    $.getJSON(html_url + 'json/get/', {'data': 'tags', 'field': 'name'}, function(data) {
        var input = $('<input />').attr('maxlength', '20').autocomplete(data).blur(function () {
                $('.ac_results').remove();
                var nameOfTag = $(this).val()
                var addElem = $(this).parent();
                if (nameOfTag && nameOfTag.length <= 20 && confirm('Do you want to add tag name ' + nameOfTag + '?')) {
                    $.post(html_url + 'json/post/', {'addtag': pid, 'text': nameOfTag}, function(data) {
                        $(addElem).html('').append(
                            $(addTagLink).click(addTag)
                        );
                        if (data) {
                            $(addTagLink).parent().before(
                                $('<li />').append(
                                    $('<a />').attr('href', html_url + 'tag/?id=' + data).attr('id', 'tag-' + data).text(nameOfTag)
                                ).append(' ').append(
                                    $('<a />').attr('href', '#removetag').text('[Remove]').click(deleteTag)
                                )
                            )
                        }
                    }, 'json');
                } else {
                    if (nameOfTag.length > 20)
                        alert('Tag name is too long. Maximum size is 20 characters and tag has ' + nameOfTag.length + '.');
                    else
                        alert('Empty string, no changes.');
                    $(addElem).html('').append(
                        $(addTagLink).click(addTag)
                    );
                    return;
                }
            })
        $(addTagLink).parent().html('').append(input);
        $(input).focus();
    });
}

function addRemoveLinkToTags() {
    $('.picturetags li:not(.addtag)').append(' ');
    $('<a />').attr('href', '#removetag').text('[Remove]').click(deleteTag).appendTo('.picturetags li:not(.addtag)');
}

function deleteTag(event) {
    event.preventDefault();
    var pid = ($(this).parent().parent().attr('id')).replace('tags-', '');
    var tid = ($(this).prev().attr('id')).replace('tag-', '');
    var tname = $(this).prev().text();
    var element = $(this).parent();
    if (confirm('Do you want to delete tag "' + tname + '"?')) {
        $.post(html_url + 'json/post/', {'deletepictag': pid, 'tid': tid}, function(data) {
            if (data) {
                $(element).fadeOut(function() {
                    $(this).remove();
                });
            } else
                return;
        });
    }
}

function showChangelog(event) {
    event.preventDefault(); /* This prevents non-ajax site transfer. */
    var pid = ($(this).attr('id')).replace('changelog-','');
    $.getJSON(html_url + 'json/get/', {'data': 'admin', 'subdata': 'changelog', 'pid': pid}, function(data) {
        if (data[0]) {
            changes = $('<table />').append(
                $('<tr />').append(
                    $('<th />').text('User')
                ).append(
                    $('<th />').text('Action')
                ).append(
                    $('<th />').text('Timestamp')
                )
            );
            $.each(data, function(i, item) {
                $(changes).append(
                    $('<tr />').append(
                        $('<td />').text(item.user)
                    ).append(
                        $('<td />').text(item.action)
                    ).append(
                        $('<td />').text(item.timestamp)
                    )
                );
            });
            $('<div />').addClass('changelog').html(changes).dialog({
                resizable: false,
                draggable: false,
                modal: true,
                closeOnEscape: false,
                width: 600,
                height: 400
            });
        } else {
            alert('No changelog for this picture.'); /* Normally, this wouldn't appear. */
        }
    });
}

function togglePicShown(event) {
    event.preventDefault();
    var link = $(this);
    var pid = ($(link).attr('id')).replace('shown-', '');
    var image = $('p#imagecontainer img');
    var shown = (!$(image).hasClass('hidden'));
    if (shown) {
        $.post(html_url + 'json/post/', {'hidepic': pid}, function(data) {
            $(image).addClass('hidden');
            $(link).text('Click to show');
        }, 'json');
    } else {
        $.post(html_url + 'json/post/', {'showpic': pid}, function(data) {
            $(image).removeClass('hidden')
            $(link).text('Click to hide');
        }, 'json');
    }
}

function deletePic(event) {
    event.preventDefault();
    var pid = ($(this).attr('id')).replace('deletepic-', '');
    $.post(html_url + 'json/post/', {'deletepic': pid}, function(data) {
        if (data) {
            location.href = html_url;
        }
    }, 'json');
}

function changeCat(event) {
    event.preventDefault();
    var changelink = $(this);
    var pid = ($(changelink).attr('id')).replace('piccat-', '');
    var oldcid = ($(changelink).prev().attr('id')).replace('cat-', '');
    var oldname = $(changelink).prev().text();
    var container = $(changelink).parent();
    $.getJSON(html_url + 'json/get/', {'data': 'admin', 'subdata': 'piccats'}, function(categories) {
        if (categories[0]) {
            var select = $('<select />');
            $.each(categories, function (i, cat) {
                var option = $('<option />').val(cat.id).text(cat.name)
                if (cat.id == oldcid)
                    $(option).attr('selected', 'selected');
                $(option).appendTo(select);
            });
            $(container).html('').append(select);
            $(select).focus().blur(function() {
                var newname = $(this).children('option:selected').text();
                var newcid = $(this).val();
                if (newcid == oldcid) {
                    $(container).html(' ').prepend(
                        $('<a />').attr('id', 'cat-'+newcid).text(oldname).attr('href', html_url + 'browse/?id=' + oldcid)
                    ).append(
                        $(changelink).click(changeCat)
                    );
                } else {
                    $.post(html_url + 'json/post/', {'changecat': pid, 'cat': newcid}, function(data) {
                        $(container).html(' ').prepend(
                            $('<a />').attr('id', 'cat-'+newcid).text(newname).attr('href', html_url + 'browse/?id=' + newcid)
                        ).append(
                            $(changelink).click(changeCat)
                        );
                    });
                }
            });
        } else
            alert('No categories to select, please insert categories first.');
    });
}

